import {NavLink} from "react-router-dom";

let Nav = () => {
    return(
        <nav>
            <NavLink to={'/hotelList'} >호텔상품 보기</NavLink>
            <NavLink to={'/popular'} className={'m-lg-3'}>인기상품 보기</NavLink>
        </nav>

    )
}

export default Nav;
